import requests

data = """"""

def reduce(data):
    while True:
        matches = set()
        prev = None
        for i in range(len(data) - 1):
            x, y = data[i], data[i + 1]
            is_deletable = (
                not (x.isupper() ^ y.islower()) and
                (x.upper() == y.upper())
            )
            if prev != (i - 1) and is_deletable:
                matches.add(i)
                matches.add(i + 1)
                prev = i
            else:
                prev = None
        if not matches:
            break
        else:
            d = "".join(c for i, c in enumerate(data) if i not in matches)
            data = d
    return data

