import string
from datetime import datetime
from collections import Counter

c = Counter(data)

d = {
    (x, y): c[x] + c[y]
    for x, y in zip(string.ascii_lowercase, string.ascii_uppercase)
}

for (x, y), count in sorted(d.items(), key=lambda kv: kv[1], reverse=True):
    s = datetime.now()
    d = data.replace(x, "").replace(y, "")
    result = reduce(d)
    e = datetime.now()
    print("{0}/{1}: {2} {3} {4}".format(x, y, count, len(result), e - s))